import Link from 'next/link';
import Head from 'next/head';
import Nav from '../components/Nav';

const Index = () => (
    <div>
        <Head>
            <title>Home Page</title>
            <meta name='description' content='SSR App with NextJS' />
        </Head>
        <Nav />
        <h2>Home Page</h2>
    </div>
);

export default Index;
